function Demo(){

    const countries =['india','australia','america'];
    const results=[];
        // countries.forEach((country,index)=>{
        //     results.push(
        //         <div key={index}>

        //         <p>{country}</p>
        //         </div>
        //     );
        // });


    for(let country of countries ){
        results.push(
            <div>
            <p>{country}</p>
            </div>
        );
    }

    for(let country in countries ){
        results.push(
            <div>
            <p>{countries[country]}</p>
            </div>
        );
    }

return (
    <p>{results}</p>

    // <div>{results.length>0 ? results : <p>No data!!!</p>}</div>;
    )
}


export default Demo;
